import { Route, Routes } from "react-router-dom";
import Home from "./components/SearchHome";
import Search from "./components/Search";

import "./App.css";

function App() {
  return (
    <>
      <Navbar/>
      <Routes>
        <Route path="/home" element={<Home/>} />
        <Route path="/about" element={<About />} />
        <Route path="*" element={<Error />} />
      </Routes>
    </>
  );
}

export default App;
